pragma solidity >=0.7.0 <0.9.0;

/**
 * @title Loterie
 * @dev Store & retrieve value in a variable
 */
contract Loterie {

    uint256 private randNonce;
    uint256 public price;
    string name;

    address[]  participants;
    address owner;

    constructor(uint256 p, string memory _name){
        owner = tx.origin;
        name = _name;
        price = p * 10**16;
    }

    function randomDraw() public returns (address) {
        require(tx.origin == owner, "Only owner can do that!");
        require(participants.length > 2, "The numbers of participants must be larger than 2");

        address winner = participants[random(participants.length)];
        payable(winner).transfer(address(this).balance);

        delete participants;

        return winner;
    }

    function getPrice() public view returns (uint256) {
        return price;
    }

    function random(uint _modulus) private returns (uint) {
        randNonce++; // Variable d’état à déclarer et initialiser à 0
        return
            uint(
                keccak256(
                    abi.encodePacked(block.timestamp, tx.origin,
                    randNonce)
                )
            ) % _modulus;
    }

    function getSolde() public view returns (uint) {
        return address(this).balance;
    }

    function getName() public view returns (string memory) {
        return name;
    }

    function participate() public payable {
        require(tx.origin != owner,"Owner can't participate");
        require(msg.value == price, "Price must be equal to the price defined by the owner of the lottery");

        bool isAlreadyParticipant = false;

        for (uint256 i = 0; i < participants.length; i++) {
            if (participants[i] == tx.origin) {
                isAlreadyParticipant = true;
                break;
            }
        }
        require(!isAlreadyParticipant, "A participant cannot participate several times");

        participants.push(tx.origin);
    }
